chunk_text:
The quality of mercy is not strained;

It droppeth as the gentle rain from heaven

Upon the place beneath. It is twice blessed;

It blesseth him that gives and him that takes.

I am glad he aptly reminded us of his wifes name during the course of his speech. I congratulate him, and I am sure we will be seeing each other again soonwithout being complacent in any way about the electorate.
